import React from 'react';
import ServerContext from '../server-context';

const WithServer = () => (Wrapped) => {
    return (props) => {
        return (
            <ServerContext.Consumer>
                {
                    (Server) => {
                        return <Wrapped {...props} RestoService={Server} />
                    }
                }
            </ServerContext.Consumer>
        )
    }
};

export default WithServer;
